import {AppBar, Button, Grid, IconButton, Toolbar, Typography} from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu';
import React, {FunctionComponent} from 'react';
import './header.css';

const Header: FunctionComponent = ()=>{
    const handleGotoSection = (event:any) => {
        console.log(event)
        window.scrollTo({
            top: 500 ,
            behavior: 'smooth'
        })
    }

    return (
        <Grid className="headerContainer">
            <AppBar position="static">
                <Toolbar>
                    <IconButton edge="start" className="menuButton" color="inherit" aria-label="menu">
                        <MenuIcon />
                    </IconButton>
                    <Typography variant="h6" className="title">
                        This is title
                    </Typography>
                    <Button color="inherit" section-id={1} onClick={handleGotoSection}>Mint</Button>
                    <Button color="inherit">Login</Button>
                    <Button color="inherit">Login</Button>
                    <Button color="inherit">Login</Button>
                    <Button color="inherit">Login</Button>
                </Toolbar>
            </AppBar>
        </Grid>
    );
}

export default Header;
